window.bookSummaryJSON = "<p><b>Instant</b><b><i> New York Times</i></b><b> and </b><b><i>USA Today</i></b><b> Best Seller</b></p> <p><b>“A great book...it’s f--king riveting!” (Joe Rogan)</b></p> <p><b>​​“Take my word for it, James Reece is one rowdy motherf--ker. Get ready!” (Chris Pratt, star of</b><b><i> The Terminal Lis</i></b><b>t, coming to Amazon Prime)</b></p> <p><b>“A rare gut-punch writer, full of grit and insight, who we will be happily reading for years to come.” (Gregg Hurwitz, </b><b><i>New York Times </i></b><b>best-selling author of the Orphan X series)</b></p> <p><b>In this third high-octane thriller in the “seriously good” (Lee Child, number-one </b><b><i>New York Times </i></b><b>best-selling author) Terminal List series, former Navy SEAL James Reece must infiltrate the Russian mafia and turn the hunters into the hunted.</b></p> <p>Deep in the wilds of Siberia, a woman is on the run, pursued by a man harboring secrets - a man intent on killing her.</p> <p>A traitorous CIA officer has found refuge with the Russian mafia with designs on ensuring a certain former Navy SEAL sniper is put in the ground.</p> <p>Half a world away, James Reece is recovering from brain surgery in the Montana wilderness, slowly putting his life back together with the help of investigative journalist Katie Buranek and his longtime friend and SEAL teammate Raife Hastings. Unbeknownst to them, the Russian mafia has set their sights on Reece in a deadly game of cat and mouse.</p> <p>In his most visceral and heart-pounding thriller yet, Jack Carr explores the darkest instincts of humanity through the eyes of a man who has seen both the best and the worst of it.</p>"; 
